import React, {useState} from 'react';
import axios from 'axios';

function GetAccountById() {

    const [data, setdata] = useState({});
    const [id, setId] = useState('')

    if(id >= 0) {
        axios.get('http://localhost:8080/accounts/' + id.toString())
            .then(res => {
                setdata(res.data);
            })
    }
    else{
        axios.get('http://localhost:8080/accounts/1')
            .then(res => {
                setdata(res.data);
            })
    }
        return (
            <div>
                <input  value={id} onChange={event => setId(event.target.value)} />
                <h1> {id} </h1>

                <table>
                    <tr>
                        <th>Firstname</th>
                        <th>LastName</th>
                        <th>Email</th>
                        <th>PhoneNumber</th>
                    </tr>
                        <tr>
                            <td>{data.firstname}</td>
                            <td>{data.lastname} </td>
                            <td>{data.email}</td>
                            <td>{data.phoneNumber}</td>
                        </tr>
                </table>
            </div>
        );

}

export default GetAccountById;
